INSERT INTO `wp_10_posts` VALUES (1,1,'2025-08-14 01:24:41','2025-08-14 01:24:41','Welcome to <a href=\"https://technologyfoc.us/\">wordpress-multisite sites</a>. This is your first post. Edit or delete it, then start writing!','Hello world!','','publish','open','open','','hello-world','','','2025-08-14 01:24:41','2025-08-14 01:24:41','',0,'http://andresanz-consulting.technologyfoc.us/?p=1',0,'post','',1),(2,1,'2025-08-14 01:24:41','2025-08-14 01:24:41','<!-- wp:paragraph -->\n<p>This is an example page. It\'s different from a blog post because it will stay in one place and will show up in your site navigation (in most themes). Most people start with an About page that introduces them to potential site visitors. It might say something like this:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:quote -->\n<blockquote class=\"wp-block-quote\"><p>Hi there! I\'m a bike messenger by day, aspiring actor by night, and this is my website. I live in Los Angeles, have a great dog named Jack, and I like pi&#241;a coladas. (And gettin\' caught in the rain.)</p></blockquote>\n<!-- /wp:quote -->\n\n<!-- wp:paragraph -->\n<p>...or something like this:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:quote -->\n<blockquote class=\"wp-block-quote\"><p>The XYZ Doohickey Company was founded in 1971, and has been providing quality doohickeys to the public ever since. Located in Gotham City, XYZ employs over 2,000 people and does all kinds of awesome things for the Gotham community.</p></blockquote>\n<!-- /wp:quote -->\n\n<!-- wp:paragraph -->\n<p>As a new WordPress user, you should go to <a href=\"https://andresanz-consulting.technologyfoc.us/wp-admin/\">your dashboard</a> to delete this page and create new pages for your content. Have fun!</p>\n<!-- /wp:paragraph -->','Sample Page','','publish','closed','open','','sample-page','','','2025-08-14 01:24:41','2025-08-14 01:24:41','',0,'http://andresanz-consulting.technologyfoc.us/?page_id=2',0,'page','',0),(3,0,'2025-08-14 01:26:05','2025-08-14 01:26:05','<!-- wp:page-list /-->','Navigation','','publish','closed','closed','','navigation','','','2025-08-14 01:26:05','2025-08-14 01:26:05','',0,'https://andresanz.consulting/2025/08/14/navigation/',0,'wp_navigation','',0),(4,1,'2025-08-23 01:09:44','2025-08-23 01:09:44','','Default Kit','','publish','closed','closed','','default-kit','','','2025-08-23 01:09:44','2025-08-23 01:09:44','',0,'https://andresanz.consulting/?p=4',0,'elementor_library','',0);
